           <img className='logo' src={"./img/logo.webp"}  alt="Логотип Eurotile" />
        
            <Nav className="ml-auto">
            <a href="URL" className='home'>посёлок Янтарный, ул.Магистральная, 1</a>
                      <Button title="Позвоните нам!" className='btn1'  variant={"outline-light"}  style= {{color: '#9C0F77'}} >
                          +7(928)-187-07-47
                     </Button>
                
            </Nav>
        </Container>
    </Navbar>
    
    );
});

